import React from 'react';


export default function MessageInput({handleChatInput, sendMessage}) {
    return(
        <div className="chat-messages-create-container footer">
        <input name="message" onChange={handleChatInput} className="chat-messages-create-input" type="text" />
        <button type="submit" className="chat-messages-create-button" onClick={e=> sendMessage(e)} > Send </button>
      </div>

    );
}
